	    + C(SC2H3OH) + C(SO) &
	    + C(SHOCO) + C(SC) &
	    + C(SAXC3H4) + C(SC2H5) &
	    + C(SC2H5CHO) + C(SACETOL) &
	    + C(SA1O) + C(SC3H4O3) &
	    + C(SCH2CO) + C(SC4H71X3) &
	    + C(SC5H4O2) + C(SH2O2)
