	    + C(SC6H6OX24) + C(SHCCO) &
	    + C(SCH2CH2CHO) + C(SC5H4CH2) &
	    + 2.5 * C(SH2) + C(SCH2CHO) &
	    + C(SC5H4CH3) + C(SCH3COCH3) &
	    + C(SA1CO) + C(SC6H8O4) &
	    + C(SCH4) + C(SC5H5) &
